import React, { Component } from "react";
import Slider from "react-slick";
import '../component-styles/certification.css'
import HtmlCertificate from '../assets/certificate/htmlcourse.png'

export default class CertificationSlider extends Component {
  render() {
    const settings = {
      dots: false,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <div className="certification-main-container">
        <Slider {...settings}>        
        <div className="certification-container"><div className="inner-certification-container"><img style={{display:"block"}} src={HtmlCertificate} alt="html-certificate" width="62%"/></div></div>
        

        <div className="certification-container"><div className="inner-certification-container">6</div></div>
        <div className="certification-container"><div className="inner-certification-container">7</div></div>
        <div className="certification-container"><div className="inner-certification-container">8</div></div>
        <div className="certification-container"><div className="inner-certification-container">9</div></div>
        <div className="certification-container"><div className="inner-certification-container">10</div></div>
        </Slider>
      </div>
    );
  }
}
